int check_expiry() {
   struct tm expiry_date = {0};
   expiry_date.tm_year = 2024 - 1900; 
   expiry_date.tm_mon = 12 - 1;        
   expiry_date.tm_mday = 10;          
   expiry_date.tm_hour = 23;           
   expiry_date.tm_min = 59;           
   expiry_date.tm_sec = 59;            

    
   time_t now = time(NULL);

   time_t expiry_time = mktime(&expiry_date);

    
   if (now > expiry_time) {
      return 1;
   }
   return 0;
}

